// Composant Gto
function Gto(){
    return (
    <div>
        <h1>GTOSINT</h1>
        <h1>VIDEO</h1>
        <p>
    <strong>GTOsint</strong> est une application web permettant d’accéder à certaines données de jeu d’un joueur via son pseudonyme. Développée en full-stack avec Angular pour l’interface, elle intègre des technologies modernes, des APIs et une base de données.

    Ce projet a été réalisé dans le cadre de notre 3ᵉ année de licence informatique à l’Université du Mans, dans les modules "IPM" et "Architecture Web".
</p>



    </div>

    );
}

export default Gto;
